#  General Punctuation 


#  bullet = black small circle, U+2022 ISOpub  


#  bullet is NOT the same as bullet operator, U+2219 


#  horizontal ellipsis = three dot leader, U+2026 ISOpub  


#  prime = minutes = feet, U+2032 ISOtech 


